import React, { useEffect, useState } from 'react';
import axios from 'axios';

const FindingBlood = () => {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://127.0.0.1:5000/data');
        console.log('Data received:', response.data);  // Log the data to the console
        setData(response.data);
      } catch (error) {
        console.error('Error fetching data:', error);  // Log the error to the console
        setError(error);
      }
    };

    fetchData();

    const script = document.createElement('script');
    script.src = `https://maps.googleapis.com/maps/api/js?key=AIzaSyD07cMGrAdZzFU1FexlCWLCWlPX-J3g6p4&libraries=places`;
    script.async = true;
    script.defer = true;
    document.head.appendChild(script);

    return () => {
      document.head.removeChild(script);
    };
  }, []);

  if (error) {
    return <div>Error: {error.message}</div>;
  }

  return (
    <div>
      <h1>Blood Supply and Demand Data</h1>
      <ul>
        {Array.isArray(data) && data.length > 0 ? (
          data.map((item, index) => (
            <li key={index}>
              {Object.entries(item).map(([key, value]) => (
                <div key={key}><strong>{key}:</strong> {value}</div>
              ))}
            </li>
          ))
        ) : (
          <div>No data available</div>
        )}
      </ul>
    </div>
  );
};

export default FindingBlood;
